package it.csi.apisan.apisanassistenza.business.apisanassistenza.mapper;

import it.csi.apisan.apisanassistenza.business.apisanassistenza.impl.service.nextcrm.dto.ModelAttachments;
import it.csi.apisan.apisanassistenza.dto.apisanassistenza.DocumentoAllegato;

public class DocumentoAllegatoMapper extends BaseMapper<DocumentoAllegato, ModelAttachments> {

	byte[] fileContent = null;
	
	public DocumentoAllegatoMapper(byte[] fileContent) {
		super();
		this.fileContent = fileContent;
	}

	@Override
	public ModelAttachments to(DocumentoAllegato source) {
		return null;
	}

	@Override
	public DocumentoAllegato from(ModelAttachments dest) {
		if (dest == null) {
			return null;
		}
		DocumentoAllegato documento = new DocumentoAllegato();
		documento.setFileName(dest.getFilename());
		documento.setContentType(dest.getMimeType());
		// documento.setFileContentAsBase64(fileContentBase64);
		// byte[] documentContent = Base64.getDecoder().decode(documento.getFileContentAsBase64().getBytes("UTF-8"));
		/*
		String fakeFileName = "example.pdf";
		String fakePdf = "";
		String contentType = "application/pdf";
		documento.setFileName(fakeFileName);
		documento.setContentType(contentType);
		documento.setFileContentAsBase64(fakePdf);
		*/
		documento.setFileContent(fileContent);
		return documento;
	}



	

}
